import { Component, OnInit } from '@angular/core';
import { NgForm } from '@angular/forms';
import { AppComponent } from 'src/app/app.component';
import { PuxarFeedService, login_infos } from 'src/app/servico/puxar-feed.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.page.html',
  styleUrls: ['./login.page.scss'],
})
export class LoginPage implements OnInit {
dados = {
  email: "",
  senha: ""
}
nome = '';
email = ''

login_infos : login_infos[] | any;


  constructor(private service: PuxarFeedService, private app_comp: AppComponent) { }

  ngOnInit() {

  }

  logar(form: NgForm){

    this.service.logar(form.value.email, form.value.senha).subscribe(response =>{
      //Object.keys(response).length
     this.login_infos = response;
     console.log(this.login_infos[0].id);



     //passando informações pro app componente
    this.app_comp.mudarInfo(this.nome, this.email)
    })


  }

}
<ion-header [translucent]="true">
  <ion-toolbar color="danger">
    <ion-title>Login</ion-title>
    <ion-menu-button color="dark" slot="start"></ion-menu-button>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
 <form #f="ngForm" (ngSubmit)="logar(f)">

  <ion-item>
    <ion-label position="floating">Email:</ion-label>
    <ion-input [(ngModel)]="dados.email" name="email"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label position="floating">Senha:</ion-label>
    <ion-input [(ngModel)]="dados.senha" name="senha"></ion-input>
  </ion-item>

  <ion-button fill="outline" expand="block" type="submit" color="success">Logar</ion-button>
</form>
</ion-content>
